const FormatTypes = {
  ASCII: 'ascii',
  BINARY: 'binary',
  APPENDED: 'appended'
};
const TYPED_ARRAY = {
  Int8Array: 'Int8',
  Uint8Array: 'UInt8',
  Int16Array: 'Int16',
  Uint16Array: 'UInt16',
  Int32Array: 'Int32',
  Uint32Array: 'UInt32',
  Float32Array: 'Float32',
  Float64Array: 'Float64'
};
var Constants = {
  FormatTypes
};

export { FormatTypes, TYPED_ARRAY, Constants as default };
